osion of civilization that the Mongol Empire unleashed, this brilliant work of revisionist history is nothing less than the epic story of how the modern world was made.</p>\",\"publisher___searchable\":\"Crown\",\"seoInformation\":{\"title\":null,\"description\":null,\"keywords\":null},\"seoUri\":\"Genghis-Khan-and-the-Making-of-the-Modern-World-en.aspx\",\"code___searchable\":\"Genghis-Khan-and-the-Making-of-the-Modern-World_1\",\"metaClassId\":30,\"catalogId\":3,\"usersWithReadAccess\":[],\"rolesWithReadAccess\":[\"CommerceAdmins\",\"Everyone\"],\"name___searchable\":\"Genghis Khan and the Making of the Modern World\"}"
