                       + "\n{\"assets\":[\"/globalassets/commerce-images/books/history/b00icn066a.01._sclzzzzzzz_sx500_.jpg\"],\"contentLink\":{\"id\":4,\"workId\":0,\"guidValue\":\"1b5ce888-70b1-46ed-a01a-177dc41c383f\",\"providerName\":\"CatalogContent\",\"url\":null,\"expanded\":null},\"language\":{\"link\":null,\"displayName\":\"English\",\"name\":\"en\"},\"existingLanguages\":[{\"link\":null,\"displayName\":\"English\",\"name\":\"en\"}],\"masterLanguage\":{\"link\":null,\"displayName\":\"English\",\"name\":\"en\"},\"contentType\":[\"Product\",\"BookProduct\",\"Content\"],\"parentLink\":{\"id\":1073741836,\"workId\":0,\"guidValue\":\"12c4761e-04ce-42bf-adc1-3fa1475da5a4\",\"providerName\":\"CatalogContent\",\"url\":\"/en/books/history/world/\",\"expanded\":null},\"routeSegment\":\"sapiens-a-brief-history-of-humankind\",\"url\":null,\"changed\":\"2021-08-08T15:41:17.957Z\",\"created\":\"2021-08-08T15:39:10Z\",\"startPublish\":\"2021-08-08T15:39:10.81Z\",\"stopPublish\":\"2031-08-08T15:39:10.81Z\",\"saved\":\"2021-08-08T15:41:17.957Z\",\"status\":\"Published\",\"displayName___searchable\":\"Sapiens: A Brief History of Humankind\",\"author___searchable\":\" Yuval Noah Harari \",\"description___searchable\":\"<p><strong><em>New York Times</em>&nbsp;Bestseller</strong></p>\n<p><strong>A Summer Reading Pick for President Barack Obama, Bill Gates, and Mark Zuckerberg</strong></p>\n<p>From a renowned historian comes a groundbreaking narrative of humanity&rsquo;s creation and evolution&mdash;a #1 international bestseller&mdash;that explores the ways in which biology and history have defined us and enhanced our understanding of what it means to be &ldquo;human.&rdquo;</p>\n<p>One hundred thousand years ago, at least six different species of humans inhabited Earth. Yet today there is only one&mdash;homo sapiens. What happened to the others? And what may happen to us?</p>\n<p>Most books about the history of humanity pursue either a historical or a biological approach, but Dr. Yuval Noah Harari breaks the mold with this highly original book that begins about 70,000 years ago with the appearance of modern cognition. From examining the role evolving humans have played in the global ecosystem to charting the rise of empires,&nbsp;<em>Sapiens</em>&nbsp;integrates history and science to reconsider accepted narratives, connect past developments with contemporary concerns, and examine specific events within the context of larger ideas.</p>\n<p>Dr. Harari also compels us to look ahead, because over the last few decades humans have begun to bend laws of natural selection that have governed life for the past four billion years. We are acquiring the ability to design not only the world around us, but also ourselves. Where is this leading us, and what do we want to become?</p>\n<p>Featuring 27 photographs, 6 maps, and 25 illustrations/diagrams, this provocative and insightful work is sure to spark debate and is essential reading for aficionados of Jared Diamond, James Gleick, Matt Ridley, Robert Wright, and Sharon Moalem.</p>\",\"publisher___searchable\":\"Harper\",\"seoInformation\":{\"title\":null,\"description\":null,\"keywords\":null},\"seoUri\":\"Sapiens-A-Brief-History-of-Humankind-en.aspx\",\"code___searchable\":\"Sapiens-A-Brief-History-of-Humankind_1\",\"metaClassId\":30,\"catalogId\":3,\"usersWithReadAccess\":[],\"rolesWithReadAccess\":[\"CommerceAdmins\",\"Everyone\"],\"name___searchable\":\"Sapiens: A Brief History of Humankind\"}"
